import Search from '../../assets/search-icon.svg';
import './search.styles.scss';
import React from 'react';
import { Link } from 'react-router-dom';

const  SearchIcon=()=> {

    return (
        <div className="template-search template-search--empty section-template--14346363142238__main-padding">
        <div className="template-search__header page-width center">
          <h1 className="h2">Search</h1>
          <div className="template-search__search">
            <form action="/search" method="get" role="search" className="search">
              <div className="field">
                <input
                  className="search__input field__input"
                  id="Search-In-Template"
                  type="search"
                  name="q"
                  value=""
                  placeholder="Search"
                />
                <label className="field__label" htmlFor="Search-In-Template">
                  Search
                </label>
                <input name="options[prefix]" type="hidden" value="last" />
                <button type="submit" className="search__button field__button" aria-label="Search">
                  <svg
                    version="1.1"
                    id="Layer_1"
                    xmlns="http://www.w3.org/2000/svg"
                    xmlnsXlink="http://www.w3.org/1999/xlink"
                    x="0px"
                    y="0px"
                    viewBox="0 0 500 500"
                    xmlSpace="preserve"
                    fill="currentColor"
                    className="icon icon-search"
                  >
                    {/* Your SVG content goes here */}
                  </svg>
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    );
  };

